    return ( 
        <div className="more">
            <div className="row">
                <div className="col">
                    <div className="row">
                        <div className="col">
                            <img src={os} alt=""/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
     );
}

export default More;
